  false,\n\t\"url\": null,\n\t\"notes\": \"Community Wildfire Protection Plan rnrnThe
  City of Austinu2019s Wildfire Database and Risk Models were developed to support
  wildfire planning and mitigation efforts in the City of Austin. The areas in Austin
  most likely to be impacted by wildfire are referred to as the Wildland Urban Interface.
  This data helps identify the potential impacts of wildfire to a diverse set of values
  ranging from the built environment and Critical Infrastructure to habitat and green
  infrastructure. A full description of the Risk model can be access through this
  link. http://www.austintexas.gov/sites/default/files/files/hsem/Section_4_-_Risk_Assessment.pdfrnrnThe
  Data was collected and analyzed by Joseph White Fire Behavior Researcher with Baylor
  University. It was derived from numerous sources as listed in the CWPP Risk Assessment
  Guide http://www.austintexas.gov/sites/default/files/files/hsem/Section_9_-_References.pdfrnrnThe
  data was created during the CWPP development process starting in April of 2013 and
  was refined up to the adoption of the CWPP and data in November of 2014.rnrnThe
  goal is to update the data every 5 years or as more updated data becomes available.\",\n\t\"license_title\":
